import { RigidBody } from '@react-three/rapier';
import { Box } from '@react-three/drei';
import * as THREE from 'three';

interface MazeProps {
  maze: number[][];
}

export const Maze: React.FC<MazeProps> = ({ maze }) => {
  const wallHeight = 2.5;
  const blockSize = 1;

  // Create professional stone texture
  const createStoneTexture = () => {
    const canvas = document.createElement('canvas');
    canvas.width = 128;
    canvas.height = 128;
    const ctx = canvas.getContext('2d')!;

    // Stone base color - medieval dungeon style
    ctx.fillStyle = '#4a4a4a';
    ctx.fillRect(0, 0, 128, 128);

    // Add stone block pattern
    const blockSize = 32;
    for (let y = 0; y < 128; y += blockSize) {
      for (let x = 0; x < 128; x += blockSize) {
        // Stone block outline
        ctx.strokeStyle = '#2a2a2a';
        ctx.lineWidth = 2;
        ctx.strokeRect(x, y, blockSize, blockSize);
        
        // Stone texture details
        for (let i = 0; i < 20; i++) {
          const px = x + Math.random() * blockSize;
          const py = y + Math.random() * blockSize;
          const size = Math.random() * 3 + 1;
          const brightness = Math.random() * 0.4 + 0.6;
          
          ctx.fillStyle = `rgb(${Math.floor(74 * brightness)}, ${Math.floor(74 * brightness)}, ${Math.floor(74 * brightness)})`;
          ctx.fillRect(px, py, size, size);
        }
      }
    }

    const texture = new THREE.CanvasTexture(canvas);
    texture.wrapS = THREE.RepeatWrapping;
    texture.wrapT = THREE.RepeatWrapping;
    texture.magFilter = THREE.NearestFilter;
    texture.minFilter = THREE.NearestFilter;
    return texture;
  };

  // Create grass texture
  const createGrassTexture = () => {
    const canvas = document.createElement('canvas');
    canvas.width = 64;
    canvas.height = 64;
    const ctx = canvas.getContext('2d')!;

    // Grass base color
    ctx.fillStyle = '#2d5a2d';
    ctx.fillRect(0, 0, 64, 64);

    // Add grass blade details
    for (let i = 0; i < 200; i++) {
      const x = Math.random() * 64;
      const y = Math.random() * 64;
      const size = Math.random() * 2 + 1;
      
      const grassColors = ['#3a6a3a', '#2d5a2d', '#1a4a1a', '#4a7a4a'];
      ctx.fillStyle = grassColors[Math.floor(Math.random() * grassColors.length)];
      ctx.fillRect(x, y, size, size);
    }

    const texture = new THREE.CanvasTexture(canvas);
    texture.wrapS = THREE.RepeatWrapping;
    texture.wrapT = THREE.RepeatWrapping;
    texture.repeat.set(8, 8);
    texture.magFilter = THREE.NearestFilter;
    texture.minFilter = THREE.NearestFilter;
    return texture;
  };

  const stoneTexture = createStoneTexture();
  const grassTexture = createGrassTexture();

  return (
    <>
      {/* Floor with cuboid collider */}
      <RigidBody type="fixed" colliders="cuboid">
        <mesh position={[maze[0].length / 2 - 0.5, -0.5, maze.length / 2 - 0.5]} receiveShadow>
          <boxGeometry args={[maze[0].length, 1, maze.length]} />
          <meshStandardMaterial map={grassTexture} />
        </mesh>
      </RigidBody>

      {/* Walls with cuboid colliders for reliable collision */}
      {maze.map((row, z) =>
        row.map((cell, x) => {
          if (cell === 1) {
            return (
              <RigidBody key={`wall-${x}-${z}`} type="fixed" colliders="cuboid">
                <Box
                  position={[x, wallHeight / 2, z]}
                  args={[blockSize, wallHeight, blockSize]}
                  castShadow
                  receiveShadow
                >
                  <meshStandardMaterial 
                    map={stoneTexture}
                    roughness={0.9}
                    metalness={0.1}
                  />
                </Box>
              </RigidBody>
            );
          }
          return null;
        })
      )}

      {/* Animated Goal Crystal */}
      {maze.map((row, z) =>
        row.map((cell, x) => {
          if (cell === 2) {
            return (
              <group key={`goal-${x}-${z}`} position={[x, 1, z]}>
                <mesh>
                  <octahedronGeometry args={[0.4, 2]} />
                  <meshStandardMaterial
                    color={0x00ff44}
                    emissive={0x00ff44}
                    emissiveIntensity={0.8}
                    transparent
                    opacity={0.9}
                    roughness={0.1}
                    metalness={0.3}
                  />
                </mesh>
                <pointLight 
                  color={0x00ff44} 
                  intensity={3} 
                  distance={15}
                  castShadow
                />
              </group>
            );
          }
          return null;
        })
      )}
    </>
  );
};
